import React from "react";
import ReactDOM from "react-dom";


const Modal = props => {
  return ReactDOM.createPortal(
      <div className="ui dimmer modals visible active fontify">
      <div className="ui standard modal visible active w-25 h-25">
          <h1 className="header fontifyr">Delete Stream</h1>
          <div className="content">
          Are you sure you want to delete this stream?
          </div>
          <div className="actions">
              <button className="btn btn-sm btn-danger m-1">Delete</button>
              <button className="btn btn-sm btn-dark">Cancel</button>
          </div>
      </div>
  </div>
      , document.getElementById("modal"));
};

export default Modal;
